import React from "react";

const DiaryEditor = () => {
  return (
    <div className="container">
      <h1>오늘의 일기</h1>
      <form>
        <input type="text" />
        <input type="textarea" />
        <div>
          <h2>오늘의 감정점수</h2>
          <input type="number" />
        </div>
        <button>일기 저장하기</button>
      </form>
    </div>
  );
};

export default DiaryEditor;
